import React, {Component} from 'react';

import {Header, Input} from 'semantic-ui-react';
import emailjs from 'emailjs-com';

class EmailSenderTest extends Component {
  constructor(props){
    super(props);
    this.onSubmit = this.onSubmit.bind(this);
    // this.state = {value: 'Testing value'};
    // this.handleChange = this.handleChange.bind(this);
    // this.handleSubmit = this.handleSubmit.bind(this);
  }

  // onSubmit(e) {
  //   e.preventDefault();
  //   var title = this.title;
  //   console.log(title);
  //   }

  render() {
    var service_id = "gmail";
    var user_id = "user_GPvH16KTRm7olTHDX1cdy"
    var template_id = "template_jPWa5xhn";
    var template_params = {
     "reply_to": "aakanksha.j.saxena@gmail.com",
     "from_name": "MeshWorks"
    }

    return (
      <div>
      <Header as='h1'> Send Email Test </Header>
      <Input
        value={this.state.inputValue}
        action={{
          // onChange={this.handleChange}
          // onClick={() => {emailjs.send(service_id, template_id, template_params, user_id); this.onSubmit;}}
          onClick: emailjs.send(service_id, template_id, template_params, user_id),
          color: 'primary',
          actionPosition: 'right',
          content: 'Send Email',
        }}
        defaultValue='worldsightvr@gmail.com'
      />
      </div>
    )
  }
}

export default EmailSenderTest;
